import './App.css';

function App() {
  return (
    <Provider>
    <Router>
    <React.Fragment>

      <Navbar/>
        <div  className="container">
          <Switch>
            <Route exact path="/" component={Index} />
            {/* <Route exact path="/lyrics/track/:id" component={Lyrics} /> */}
          </Switch>
        </div>

   </React.Fragment>
    </Router>
    </Provider>
  );
}

export default App;
